import * as types from './ActionTypes';

export const ActionResetTimer = () => ({ type: types.RESET_TIMER });
export const ActionTickTimer = () => ({ type: types.TICK_TIMER });
export const ActionStopTimer = () => ({ type: types.STOP_TIMER });
